import React from 'react';


const CountryList = ({ countries }) => {
  return (
    <div>
      {countries.map((country, index) => (
        <Country
          key={index}
          name={country.name}
          flag={country.flag}
          capital={country.capital}
          continent={country.continent}
          poblation={country.population}
        />
      ))}
    </div>
  );
};

export default Country;
